import React, { Component } from 'react'
import {
    BrowserRouter as Router,
    Route,
    Link
  } from "react-router-dom";
import Config from '../tempo'
import Menu from './menu';
import api from '../services/api'

export default class Evaluation extends Component {


    state = {
        show: false,
        loader: true,
        evaluation: [],
        users: [],

        usuario: '',
        foto: null,
        aviso: ''
    }

    handleImageChange = (e) => {
        this.setState({
          fotos: e.target.files.length <= 4 ? e.target.files[0] : 
          this.setState({
              aviso: 'Não pode selecionar mais de 4 fotos'
          })
        })
      };

    handleChange = e => {
        this.setState({
          [e.target.name]: e.target.value
        })
      }


    async componentDidMount() {
        const { id }  = this.props.match.params;
        const company_id = localStorage.getItem('@Coliseu')

        const evaluation = await api.get(`/auth/evaluation`)
        const users = await api.get(`/auth/user`)

        console.log(evaluation.data)
        console.log(users.data)

        this.setState({
            evaluation: evaluation.data,
            users: users.data
        })

        setTimeout(() =>{
            this.setState({ 
                show: true ,
                loader: false
            })   
        }, Config())
    }

    render(){
        const { users } = this.state;
    return (
    <div>
        {this.state.loader === true ? 

            <div className="container fundo">
                <div className="row loader">
                    <div className="col s12 center">
                        <img src="../../logo.svg" width="100px" height="100px" />
                    </div>
                </div>
            </div>
            :

            <div>
                <Menu />
            <div className="orelha"></div>
            <div className="parallax-container targetTopo">
                    <div className="parallax corPadrao">
                        <div className="container">
                            {/* <Link to="/app">
                                <i className="material-icons left medium white-text">chevron_left</i>
                            </Link> */}
                            <h2 style={{ color: '#fff' }}>Avaliação</h2>
                        </div>
                    </div>
            </div>
            <div className="container">
                <div className="row">
                    <form className="col s12">
                        <div className="card-panel" style={{ marginTop: '-40px', borderRadius: '22px' }}>
                        Avaliação
                        </div>
                        <div className="input-field  col s6 fotos">
                            <p>Usuário</p>
                        </div>
                        <div className="input-field  col s6 fotos">
                            <p>Fotos</p>
                        </div>
                        <div className="input-field  col s6">
                            <select  className="browser-default inputUser validate"  name="usuario"
                                onChange={this.handleChange}>
                                    <option onChange={this.handleChange} selected value="001">Selecione Usuario</option>
                                {  
                                    users.map((el) => (    
                                        <option key={el.id} value={el.id} onChange={this.handleChange}>{el.name}</option>
                                    ))
                                }
                            </select> 
                        </div>
                        <div className="input-field row">
                            <div className="col s3 fotos">
                                <img src={this.state.fotos} 
                                style={{width: '50px', height: '50px'}} />
                            </div>
                            <div className="col s3 fotos">
                                segunda
                            </div>
                            <div className="col s3 fotos">
                                terceira
                            </div>
                            <div className="col s3 fotos">
                                quarta
                            </div>
                        </div>

                        <div className="col s4 center">
                            <label className="corPadrao white-text">Foto do Usuário</label>
                            <div className = "file-field input-field">
                                <div className = "btn corPadrao">
                                <span>Selecionar</span>
                                <input type = "file" 
                                    name="image[]"
                                    accept="image/png, image/jpeg"  
                                    onChange={this.handleImageChange} 
                                    required

                                />
                                </div>

                                <div className = "file-path-wrapper">
                                <input className = "file-path validate" type = "text"
                                    placeholder = "Upload file" 
                                    required
                                    />
                                </div>
                            </div>
                        </div>
                    </form>
                </div>
            </div>
        </div>
    }
    </div>
    )
}}
